items.description:
O objetivo do tutorial é apresentar ferramentas para manipulação de dados geo-espaciais, raster e vetor, e alguns conceitos e operações básicas de SIG.

Objetos de aprendizagem:
- compreender a diferenças entre dados raster e vetor;
- ler, explorar, e graficar dados geo-espaciais;
- conceitos e operações básicas de SIG;
- compor mapas temáticos estáticos e interativos.
